css:
.keymap-generator {
  display: flex;
  flex-direction: column;
  padding: 1.5em;
  font-size: 1em;
  color: #a3a8ae;
  background-color: #1d1f21;
  overflow-x: auto;
}
.keymap-generator .header {
  flex-shrink: 0;
}
.keymap-generator .header .title {
  font-size: 1.7em;
}
.keymap-generator .keys-events-panel {
  flex-shrink: 0;
  display: flex;
  flex-direction: row;
  margin-bottom: 1em;
}
.keymap-generator .keys-events-panel .key-box {
  diplay: flex;
  flex: 1;
  padding: 1em;
  border: 1px solid #111314;
  background-color: #27292c;
  border-radius: 3px;
  margin-right: 1em;
}
.keymap-generator .keys-events-panel .key-box .section-heading {
  margin-bottom: 1em;
}
.keymap-generator .keys-events-panel .key-box .key-attribute-row {
  display: flex;
  flex-direction: row;
}
.keymap-generator .keys-events-panel .key-box .key-attribute-row * {
  display: flex;
  flex: 1;
}
.keymap-generator .keys-events-panel .key-box:last-child {
  margin-right: 0;
}
.keymap-generator .modifier-bar-panel {
  display: flex;
  flex-shrink: 0;
  flex-direction: row;
  margin-bottom: 1em;
}
.keymap-generator .modifier-bar-panel .modifier {
  flex: 1;
  padding: 1em;
  border: 1px solid #111314;
  text-align: center;
  background-color: #27292c;
  border-radius: 3px;
  margin-right: 1em;
}
.keymap-generator .modifier-bar-panel .modifier:last-child {
  margin-right: 0;
}
.keymap-generator .modifier-bar-panel .modifier-active {
  background-color: #52a8ff;
  color: #ffffff;
}
.keymap-generator .key-input-panel {
  margin-bottom: 1em;
  display: flex;
  flex-shrink: 0;
  flex-direction: column;
  align-items: stretch;
}
.keymap-generator .key-input-panel .key-label {
  color: rgba(163, 168, 174, 0.6);
  margin-bottom: 0.3em;
}
.keymap-generator .key-input-panel .key-input {
  background-color: #0f1011;
  border: 1px solid #111314;
  border-radius: 3px;
  padding: 3px 0px 3px 10px;
  font-weight: normal;
  font-size: 17px;
  color: #a3a8ae;
}
.keymap-generator .key-input-panel .key-input:focus {
  padding: 2px 0px 2px 10px;
  border: 2px solid #52a8ff;
}
.keymap-generator .test-key-panel {
  margin-bottom: 1em;
  display: flex;
  flex-shrink: 0;
  flex-direction: column;
  align-items: stretch;
  justify-content: space-around;
}
.keymap-generator .test-key-panel .test-key-label {
  color: rgba(163, 168, 174, 0.6);
  margin-bottom: 0.3em;
}
.keymap-generator .test-key-panel .test-key-input {
  background-color: #0f1011;
  border: 2px solid #111314;
  border-radius: 3px;
  padding: 2px;
}
.keymap-generator .test-key-panel .test-key-input:focus {
  border: 2px solid #52a8ff;
}
.keymap-generator .map-table-panel {
  padding: 1em;
  border: 1px solid #111314;
  background-color: #27292c;
  border-radius: 3px;
  overflow-x: auto;
}
.keymap-generator .map-table-panel .map-table {
  clear: both;
}
